import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';

const Footer = () => {

    const loaction = {
        display : 'flex'
    }
    const loactionIcon = {
        padding : '0px 10px 0px 0px'
    }
    return(
        <div>
            <Container fluid="sm">
            <Row >
                <Col xs={12} md={8} lg={4}>
                    <Card>
                    <Card.Body>
                        <div style={loaction}>
                            <div style={loactionIcon}><ion-icon name="locate-outline"></ion-icon></div>
                            <div>
                                <div>Locate us</div>
                                <div>King Street, Tirupati</div>
                            </div>
                        </div>
                    </Card.Body>
                    </Card>
                </Col>
                <Col xs={12} md={8} lg={4}>

                </Col>
                <Col xs={12} md={8} lg={4}>

                </Col>
                </Row>
                </Container>
        </div>
    )
}

export default Footer;
